import "./Header.scss";
import logo from "../../assets/logo/BrainFlix-logo.svg";
import search from "../../assets/icons/search.svg";
import upload from "../../assets/icons/upload.svg";
// import avatar from "../../assets/images/Mohan-muruge.jpg";
// import Button from "../Button/Button";

function Header() {
  return (
    <header className="Header">
      <nav>
        <div>
          <img src={logo} alt="logo" className="Header__logo" />
        </div>
        <form className="Form">
          <input type="text" placeholder="Search" className="Form__search" />
          <img src={search} alt="search" className="form__search" />
          <div className="form__upload">
            <div className="form__upload-button">
              <button type="submit" className="form__upload-button-text">
                UPLOAD
              </button>
              <img src={upload} alt="up" />
            </div>
            <div className="form__profile" alt="avatar"></div>
          </div>
        </form>
      </nav>
    </header>
  );
}

export default Header;
